import React, { useState } from "react";
import styles from "./Registration.module.css";
// import { User, AuthenticationService } from "./AuthenticationSingleton.ts";
import Button from "../UI/Button/Button.js";

const Registration = (props) => {

  return (
    <div className={styles.authenticationBlock}>
      <div className={styles.registryBox}>
        <div className={styles.registryBox__form}>
          <h3>Register window</h3>
          <form className={styles.registryBox__form}>
            <label htmlFor="cityUser">Email Address / Username</label>
            <input type="text" name="emailUser" placeholder="Enter your username"></input>
            <label htmlFor="idUser">Password</label>
            <input type="password" name="passwordUser" placeholder="Enter password" ></input>
            <span>
            Already have an account? <a href="">Login</a>
          </span>
            <Button>Register Now</Button>
          </form>
        </div>
      </div>
    </div>
  );
};
export default Registration;
